import React, { Component } from 'react';

class UserOutput extends Component {
    render() {
        return (
            <div className="UserOutput">
            <p>{this.props.username}</p>
            <p>first paragraph</p>
            <p>second paragraph</p>
            </div> )
    }
};

export default UserOutput;
